import React from 'react';
import {Route, Routes} from 'react-router-dom'
import Home from './routes/Home'
import Test from './routes/Test'


function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={Home}/>
        <Route path="/test" component={Test}/>
      </Routes>
    </div>
  );
}

export default App;
